Thread t = new Thread(() =>
{
 uint itemId = 29513;
 int questId = 10369;
 
 while (robotManager.Products.Products.IsStarted)
 {
  if (Conditions.InGameAndConnectedAndAliveAndProductStartedNotInPause)
  {
   if (!Quest.HasQuest(questId))
    break;
   if (ObjectManager.Target.IsValid && ObjectManager.Target.IsAlive && ObjectManager.Target.HealthPercent <= 99)
   {
    ItemsManager.UseItem(itemId);
   }
  }
  Thread.Sleep(5000);
 }
});
t.Start();

